import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const RegisterFormPage = () => {
  const navigate = useState();
  const[name,setName] = useState('');
  const[email,setEmail] = useState('');
  const[password,setPassword] = useState('');
    return(
        <>
         <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems:'center',
        '& .MuiTextField-root': { width: '25ch' },
      }}
    >
      <h1>Welcome to Sign up Page:</h1>
      <TextField type="text" label={'Name="username"'} id="margin-normal" margin="normal" onChange={(e) => setName(e.target.value)}/>
      <TextField type="email" label={'Email="email"'} id="margin-normal" margin="normal" onChange={(e) => setEmail(e.target.value)}/>
      <TextField type="password" label={'Password="password"'} id="margin-normal" margin="normal" onChange={(e) => setPassword(e.target.value)}/>
      <Button variant="contained">Register</Button>
      <h2>OR</h2>
      <Button variant="contained">Log In</Button>
    </Box>
        </>
    )
}

export default RegisterFormPage;
